  export function Shutdown(SystemSuspending) {
      if(SystemSuspending){
          sendColors("#000000"); // Go Dark on System Sleep/Shutdown
      }else{
          sendColors(shutdownColor);
      }
  }
  
  function sendColors(shutdown=false) {
    let packetStart= [0x00,0x00,0x00,0x00,0x00,0x09,0x00,0x005,0x01];

    let packet =[];
    packet[0] = device.getBrightness()*(255/100);
    packet[1]=0xff;
    packet[2]=0x04;
    packet[2]=0x00;
    
            let iPxX = 0;
            let iPxY = 0;
            var color;
    
            if(shutdown)
        {
                color = hexToRgb(shutdownColor);
            }
        else if (LightingMode === "Forced") 
        {
                color = hexToRgb(forcedColor);
            }
        else
        {
                color = device.color(iPxX, iPxY);
                
            }
    
            
            packet[3] =  color[0];
            packet[4] = color[1];
            packet[5] = color[2];
  
            let packets = packetStart.concat(packet);
         //   console.log(packets);
            for (let i=0+packets.length;i<527;i++)
              {
                packets[i]=0x00;
              }
    //packet[89] = CalculateCrc(packet); // Example Crc
    device.send_report(packets, 527); 
  
  }


  function hexToRgb(hex) {
    let result = /^#?([a-f\d]{2})([a-f\d]{2})([a-f\d]{2})$/i.exec(hex);
    let colors = [];
    colors[0] = parseInt(result[1], 16);
    colors[1] = parseInt(result[2], 16);
    colors[2] = parseInt(result[3], 16);
  
    return colors;
  }
  
